class User:    def __init__(self,first_name,last_name,age):        self.first_name = first_name        self.last_name = last_name        self.age = age    def describe_user(self):        print(self.first_name,self.last_name+"'s age is "+str(self.age))    def greet_user(self):        print("Hello, "+self.first_name,self.last_name)class Admin(User):    def __init__(self,first_name,last_name,age,privileges):        super().__init__(first_name,last_name,age)        self.privileges = Privileges(privileges)class Privileges:    def __init__(self,privileges):        self.privileges = privileges    def show_privileges(self):        for i in self.privileges:            print(i)            joker = Admin("Joker","Xu",27,["can add post","can delete post","can ban user"])joker.privileges.show_privileges()